import React, {Component} from 'react';

class Image extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        const image = this.props;
        return (
            <img src={image.urls.small} key={image.description} alt={image.id}/>
        );
    }
}

export default Image;
